import React, { Component } from 'react';
import Objects from './components/objects.js';

class App extends Component {
  state = {
    objects:[]
  }



// There is a bit to unpakc in the user of arrow function expressions etc in the componentDidMount method

  componentDidMount(){
    fetch('https://api.nasa.gov/neo/rest/v1/feed?start_date=2015-09-07&end_date=2015-09-08&api_key=UrXJyJZWfOwzULw07rfPFuiur4cEsYCmC7WaSkTZ')
    .then(res => res.json())
    .then((data) => {
      this.setState({ objects:data })
    })
    .catch(console.log)
  }

  render () {
    return (
    <div class ="card">
      <div class="card-body">
        <h5 class ="card-title"> Name of Near Earth Object </h5>
          <h6 class ="card-subtitle mb-2 text-muted"> Miss Distance of Object</h6>
          <p class ="card-text">Absolute magnitude of object</p>
      </div>
    </div>

    );
  }
}

export default App;
